object ArabicRoman {

  type =?>[A, B] = PartialFunction[A, B]

  val codeTable = List(
    (1000, "M"), (900, "CM"), (500, "D"), (400, "CD"), (100, "C"),
    (90, "XC"), (50, "L"), (40, "XL"), (10, "X"), (9, "IX"), (5, "V"), (4, "IV"), (1, "I"))

  val arabicToRoman: Int =?> String = {
    case src if src >= 1 && src <= 3999 =>

      def convert(left: Int, cont: String = "", code: List[(Int, String)] = codeTable): String = {
        val (unitVal, unitChar) = code.head
        left - unitVal match {
          case n if n == 0 => cont + unitChar
          case n if n > 0 => convert(n, cont + unitChar, code)
          case _ => convert(left, cont, code.tail)
        }
      }

      convert(src)
  }

  val romanToArabic: String =?> Int = {
    case src if Option(src).exists { s => {
      s.nonEmpty && """[^MDCLXVI]""".r.findFirstMatchIn(s.toUpperCase).isEmpty
    }
    } =>

      def convert(left: String, cont: Int = 0, code: List[(Int, String)] = codeTable): Int = {
        val (unitVal, unitChar) = code.head
        left.splitAt(unitChar.length) match {
          case ("", _) => cont
          case (`unitChar`, tail) => convert(tail, cont + unitVal, code)
          case _ => convert(left, cont, code.tail)
        }
      }

      convert(src.toUpperCase())
  }
}

import scala.annotation.tailrec
object Main extends App {
  import scala.io.StdIn._


  val n = readInt
  val liquid = Array.tabulate(n){ _ ⇒
    val Array(color, density) = readLine.trim.split(' ')
    color → density.toInt
  }.groupBy(_._1).mapValues(_.map(_._2).sorted.toList)
  val layers = List.tabulate(readInt){ _ ⇒ readLine.trim }
  println(if(canMake(liquid, layers)) "Yes" else "No")
  def canMake(liquid: Map[String, List[Int]], layer: List[String]): Boolean = {
    @tailrec
    def sub(li: Map[String, List[Int]], la: List[String], weight: Int = 0): Boolean = {
      la match {
        case Nil ⇒ true
        case h::_ if !li.contains(h) ⇒ false
        case h::t ⇒
          li(h).span(_ <= weight) match {
            case (_, w::ws) ⇒ sub(li.updated(h, ws), t, w)
            case _ ⇒ false
          }
      }
    }
    sub(liquid, layer)
  }

  implicit class Scope[T](val value: T) extends AnyVal {
    @inline
    def let[A](func: T ⇒ A): A = func(value)
    @inline
    def also(func: T ⇒ Unit): T = {
      func(value)
      value
    }
  }
}

